import {
    callCourseListApi, callCreateApi
} from "../course/services";
import {callEnrolListApi, callUsersListApi} from "./services";


export function getCourseList(page, limit) {
    return new Promise((resolve, reject) => {
        return callCourseListApi(page, limit, (response) => {
            return response.status ?
                resolve(response.result.data.docs)
                :
                reject(response)
        })
    });
}

export function saveEnrol (obj) {
    return new Promise((resolve, reject) => {
        return callCreateApi('enrol', obj, (response) => {
            if (response.status) {
                resolve(response.result.data)
            } else {
                reject(response)
            }
        })
    });
}

export function getEnrolList(page, limit) {
    return new Promise((resolve, reject) => {
        return callEnrolListApi(page, limit, (response) => {
            return response.status ?
                resolve(response.result)
                :
                reject(response)
        })
    });
}

export function getUsersList(page, limit) {
    return new Promise((resolve, reject) => {
        return callUsersListApi(page, limit, (response) => {
            return response.status ?
                resolve(response.result.data)
                :
                reject(response)
        })
    });
}
